import React, { useEffect, useState } from 'react';
import { obtenerUsuarios } from '../servicios/clienteaxios';

const ListaUsuarios = () => {
  const [usuarios, setUsuarios] = useState([]);

  useEffect(() => {
    const obtenerUsuariosRegistrados = async () => {
      try {
        const usuariosObtenidos = await obtenerUsuarios();
        setUsuarios(usuariosObtenidos);
      } catch (error) {
        console.log(error);
      }
    };

    obtenerUsuariosRegistrados();
  }, []);

  return (
    <div className="card shadow border-0" style={{ position: 'relative', top: '0px', left: '350px', maxWidth: '240px' }}>
      <div className="card-body">
        <h3 className="card-title">Usuarios Registrados</h3>
        <ul className="list-group">
          {usuarios.map((user) => (
            <li key={user.id} className="list-group-item">{user.usuario}</li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default ListaUsuarios;
